import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import './App.css';
import TodoList from './components/TodoList';
import ReviewState from './components/ReviewState';

function App() {
  return (
    <Router>
      <div className = "App">
        <div className = "content">
          <Routes>
            <Route exact path = "/">
              <TodoList/>
            </Route>
          </Routes>
        </div>
      </div>
    </Router>
    
  );
}

export default App;
